import "react-multi-carousel/lib/styles.css";
import "../components/Other/style.css";
import UAParser from "ua-parser-js";
import React, {Fragment} from "react";
import WithScrollbar from "../components/Other/WithScrollbar";
// import WithVideo from "../components/Other/WithVideo";
import Section from "../components/Other/Section";

// Because this is an inframe, so the SSR mode doesn't not do well here.
// It will work on real devices.
const Index = ({deviceType}) => {
    return (
        <>
            <Fragment>
                <Section>
                    <WithScrollbar/>
                </Section>
            </Fragment>
        </>
    );
};
Index.getInitialProps = ({req}) => {
    let userAgent;
    if (req) {
        userAgent = req.headers["user-agent"];
    } else {
        userAgent = navigator.userAgent;
    }
    const parser = new UAParser();
    parser.setUA(userAgent);
    const result = parser.getResult();
    return {deviceType};
};
export default Index;
